import React, { Component } from 'react';
import Aux from '../../hoc/Aux/Aux';
import classes from './Summary.module.css';


class Summary extends Component {

    render() {
        let fullSequence = {
            ...this.props.seq
        };
        for (let character in fullSequence) {
            //console.log(this.props.seq[character].fontcolor('red'));
            switch (fullSequence[character]) {
                case ('A'):
                    console.log("trigger");
                    fullSequence.fontcolor('red');
                case ('G'):
                    fullSequence.fontcolor('green');
                case ('T'):
                    fullSequence.fontcolor('blue');
                case ('C'):
                    fullSequence.fontcolor('indigo');
                default:
                    fullSequence.fontcolor('black');

            }
        }
        console.log(fullSequence);
        return (
            <Aux>

                <p>{fullSequence}</p>

            </Aux>
        );
    }



};

export default Summary;
